import { Link } from "react-router-dom";
import styled from "styled-components";

const HeaderFixed = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  width: 100%;
  height: 100px;
  background-color: red;
`;
const LeftHeader = styled.div`
  display: flex;
  align-items: flex-start;

  flex-direction: column;
  margin-left: 30px;
  div {
    display: flex;
    margin-left: 10px;
    input {
      margin-left: 30px;
    }
  }
`;

const Nav = styled.div`
  width: 100%;
  height: 35px;
`;

const Navul = styled.ul`
  list-style: none;
  padding-left: 0px;
  margin: 0%;
  width: 100%;
  margin-top: 20px;
  a {
    color: black;
    float: left;
    height: 100%;
    margin-left: 10px;
    :hover {
      font-weight: 800;
    }
  }
`;

const LogIn = styled.div`
  margin-right: 30px;
  top: 50px;
`;

function YenaHeader() {
  return (
    <>
      <HeaderFixed>
        <LeftHeader>
          <div>
            <div>logo</div>
            <input placeholder="작품이나 작가의 이름을 검색해보세요."></input>
          </div>
          <Nav>
            <Navul>
              <Link to="*">
                <li>작품</li>
              </Link>
              <Link to="*">
                <li>작가</li>
              </Link>
              <Link to="*">
                <li>갤러리</li>
              </Link>
              <Link to="*">
                <li>옥션</li>
              </Link>
              <Link to="*">
                <li>아트페어</li>
              </Link>
              <Link to="*">
                <li>전시</li>
              </Link>
              <Link to="*">
                <li>박물관</li>
              </Link>
              <Link to="*">
                <li>재단</li>
              </Link>
            </Navul>
          </Nav>
        </LeftHeader>
        <LogIn>로그인</LogIn>
      </HeaderFixed>
    </>
  );
}

export default YenaHeader;
